import React from 'react';
import Header from './components/Header';
import MaintenanceBody from './components/MaintenanceBody';
import Footer from './components/Footer';
import './App.css';

function App() {
  return (
    <div className="App">
      <Header />
      <MaintenanceBody />
      <Footer />
    </div>
  );
}

export default App;
